import React from 'react';
import { ImageBackground, StyleSheet, Text, View, Button, Image } from 'react-native';
import Logo from './assets/background.png'; // it says theres an error but the image still shows up

export default class App extends React.Component {
  render() {
    return (
      <View style={styles.container}>
        <ImageBackground source={Logo}  style={styles.image}>
          <View style={styles.row}>
            <View style={styles.container}>
              <Text style={styles.h1}>GeneAI</Text>
            </View>
            <View style={styles.row}>
              <Text style={styles.h2}>test</Text>
              <Text style={styles.h2}>test2</Text>
              <Text style={styles.h2}>test3</Text>
              <View style={styles.buttonContainer}>
            <Button
            title="Log in"
            color="#f194ff"
            onPress={() => alert('You just logged in!')}
            />
          </View>
            </View>
          </View>
          
          <Text style={styles.h2}>A ONE-OF-A-KIND DATING EXPERIENCE.</Text>
        </ImageBackground>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'space-between',
    backgroundColor: '#000',
    alignItems: 'center',
    width: '100%',
  },
  row: {
    flexDirection: 'row',
    flex: 1,
    justifyContent: 'space-between',
    backgroundColor: '#000',
    alignItems: 'center',
    width: '70%',
  },
  h1: {
    color: '#008F68',
    fontSize: 40,
  },
  h2: {
    color: '#FAE042',
    fontSize: 18,
    marginTop: 8,
  },
  image: {
    width: 300,
    height: 260,
    justifyContent: 'center',
  },
  buttonContainer: {
    backgroundColor: '#008F68',
    borderRadius: 5,
    padding: 8,
    margin: 8,
  },
});
